import axios from "axios";
//import { Jwt } from "jsonwebtoken";

function GetServers()  {

    const TOKEN =
      "eyJ1c2VybmFtZSI6Im94eWxhYnMiLCJwYXNzd29yZCI6InBhcnR5YW5pbWFsIiwiYWxnIjoiSFMyNTYifQ.eyJzdWIiOiIxMjM0NTY3ODkwIiwibmFtZSI6IkpvaG4gRG9lIiwiaWF0IjoxNTE2MjM5MDIyfQ.jXcJGj1q1X3Gk1C-CoZlbF1bZwm6aTmWeuF6Axf0_CM";
    axios.interceptors.request.use(
      config => {
        config.headers.authorization = `x-access-token: ${TOKEN}`
        return config;
      },
      error => {
        return Promise.reject(error);
      }
    );

    const { isLoaded, servers } = this.state;

    const fetchData = useCallback(async () => {
      try {
        const result = await axios.get("https://playground.oxylabs.io/api/servers")
        console.log(result)
      } catch (err) {
        console.log(err)
      }
    })
    fetchData()

    if (!isLoaded) {
      return <div className="p-4 display-6">Loading data from API...</div>;
    } else {
      return (
        <div className="servers">
          <div className="">
            {servers.map((server, index) => {
              return (
                <div key={index}>
                  <div>{server.title}</div>
                </div>
              );
            })}
          </div>
        </div>
      );
    }
}

export default GetServers;
